import React from 'react';

const Home = () => {
    return (
        <div>
            <header className="header">
                <div className="click"></div>
                <div className="nav">
                    <ul>
                        <li><Link to="/">Home</Link></li>
                    </ul>
                </div>
                <h2>Budg<span>etify</span></h2>
            </header>
        </div>
    )
}

export default Home;
